exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.xbing.cc/book/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/float-list[^"]*"[^>]*>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)"[^>]*>(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};